INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6064', 'en', 'default', 'f067f6f2a07a9f28b8acd051de12bd8f', '<strong><em>Note that password</em></strong> carefully! It is a <em>random</em> password that was generated just for you.', '0', '0', 'LINE', '', '10', '', '667f6a0fa877d898323aca1fc507a99e', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6065', 'en', 'default', 'ecdb52fb00d5aabe4e9d24b436f9b9fc', '<strong>Activity</strong> &mdash; Shows the upcoming scheduled posts, recently published posts, and the most recent comments on your posts and allows you to moderate them.', '0', '0', 'LINE', '', '10', '', '92492a427dfb72cd1b97719e8e35e896', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6066', 'en', 'default', 'a6babfcb475f676a839ed6c0640d1a7d', '<strong>Advice:</strong> think very carefully about your site crashing if you are live-editing the theme currently in use.', '0', '0', 'LINE', '', '10', '', 'ad4647305c60cfd93de5e674fc745759', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6067', 'en', 'default', 'a8f4d14621490c3a1b94015a6744f684', '<strong>At A Glance</strong> &mdash; Displays a summary of the content on your site and identifies which theme and version of WordPress you are using.', '0', '0', 'LINE', '', '10', '', '63cb0e79249a3955ef8698cb0ff6b575', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6068', 'en', 'default', 'b65fa8d75f92ea10c226c9c9e107cfc6', '<strong>Box Controls</strong> &mdash; Click the title bar of the box to expand or collapse it. Some boxes added by plugins may have configurable content, and will show a &#8220;Configure&#8221; link in the title bar if you hover over it.', '0', '0', 'LINE', '', '10', '', '54545fe38eda999a7a67927af2e0e559', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6069', 'en', 'default', '2bc2b92ef21e54b7d57719af3e03b906', '<strong>Clicking the arrow to the right of any menu item</strong> in the editor will reveal a standard group of settings. Additional settings such as link target, CSS classes, link relationships, and link descriptions can be enabled and disabled via the Screen Options tab.', '0', '0', 'LINE', '', '10', '', '44adfce5db156b9d67e7c275453a89b9', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6070', 'en', 'default', 'b1223bca091660d2cb26c4403f354ea0', '<strong>Compatible</strong> with your version of WordPress', '0', '0', 'LINE', '', '10', '', '96c7d1203469aa395da152a984342fe8', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6071', 'en', 'default', '019360949341be40f9abc62e0d947806', '<strong>Connection lost.</strong> Saving has been disabled until you&#8217;re reconnected.', '0', '0', 'LINE', '', '10', '', 'c7ad62cbc8e82263e1ecdbb66fe5fb52', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6072', 'en', 'default', '009d122ea5b480829aa49478250882f2', '<strong>Delete</strong> brings you to the Delete Users screen for confirmation, where you can permanently remove a user from your site and delete their content. You can also delete multiple users at once by using Bulk Actions.', '0', '0', 'LINE', '', '10', '', '6f347940b95b62848846a02047a935e5', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6073', 'en', 'default', '455ea6f84b4f4e0349d551dbb50d3a42', '<strong>Description</strong> &mdash; The description is not prominent by default; however, some themes may display it.', '0', '0', 'LINE', '', '10', '', 'bf0e83818cfea660dd6082860a6da784', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6074', 'en', 'default', '72a914bd12c78373873416f57b033b13', '<strong>Discussion</strong> &mdash; You can turn comments and pings on or off, and if there are comments on the post, you can see them here and moderate them.', '0', '0', 'LINE', '', '10', '', 'feb178d959aae886b2dde85248492051', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6075', 'en', 'default', '71ce1121b4c5579d8f2c8e71335b9a22', '<strong>Drag and Drop</strong> &mdash; To rearrange the boxes, drag and drop by clicking on the title bar of the selected box and releasing when you see a gray dotted-line rectangle appear in the location you want to place the box.', '0', '0', 'LINE', '', '10', '', '5152a8dbc58f8c3531ec3b414be417aa', '0', '');
