INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6085', 'en', 'default', '9b0ce93b03db1e1cd98decc6387fa90c', '<strong>Edit</strong> takes you to the editable profile screen for that user. You can also reach that screen by clicking on the username.', '0', '0', 'LINE', '', '10', '', '11696b2610f2bbca1738397defd5ba29', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6086', 'en', 'default', '0bdd62cf14b1ac2df851e97eed7faa8c', '<strong>Edit</strong> takes you to the editing screen for that post. You can also reach that screen by clicking on the post title.', '0', '0', 'LINE', '', '10', '', '74deb9541548900791736df7e47727d1', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6087', 'en', 'default', '1d667c275a75b28bd9a3d3befcc8d270', '<strong>Format</strong> &mdash; Post Formats designate how your theme will display a specific post. For example, you could have a <em>standard</em> blog post with a title and paragraphs, or a short <em>aside</em> that omits the title and contains a short text blurb. Please refer to the Codex for <a href="https://codex.wordpress.org/Post_Formats#Supported_Formats">descriptions of each post format</a>. Your theme could enable all or some of 10 possible formats.', '0', '0', 'LINE', '', '10', '', 'a802c479a057bc8c8d3892f320b37b76', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6088', 'en', 'default', 'd7cb0009b8a18e9d23b53e25112dad2a', '<strong>Important:</strong> before updating, please <a href="https://codex.wordpress.org/WordPress_Backups">back up your database and files</a>. For help with updates, visit the <a href="https://codex.wordpress.org/Updating_WordPress">Updating WordPress</a> Codex page.', '0', '0', 'LINE', '', '10', '', '6ed87801b66365a3f38d73cebc5f0f41', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6089', 'en', 'default', 'adc736d6139e1287f1d9baaf718f5522', '<strong>Incompatible</strong> with your version of WordPress', '0', '0', 'LINE', '', '10', '', '13e0073401d88b673152424e5da67e61', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6090', 'en', 'default', '996b2b4aa8413fcd0f6d148b2af946a6', '<strong>Info</strong> &mdash; The site URL is rarely edited as this can cause the site to not work properly. The Registered date and Last Updated date are displayed. Network admins can mark a site as archived, spam, deleted and mature, to remove from public listings or disable.', '0', '0', 'LINE', '', '10', '', '3d34da6684f8784cc40405ae4bc6550d', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6091', 'en', 'default', '1c8ad85a1a29170a2c98285371e4ac2d', '<strong>Name</strong> &mdash; The name is how it appears on your site.', '0', '0', 'LINE', '', '10', '', '5febbe59b4e8c2b38e143b3cff8ae190', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6092', 'en', 'default', 'dac04065919539b3bb81eb4152251ca4', '<strong>Order</strong> &mdash; Pages are usually ordered alphabetically, but you can choose your own order by entering a number (1 for first, etc.) in this field.', '0', '0', 'LINE', '', '10', '', 'f11c47af7f98788ea05b855c41902aa2', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6093', 'en', 'default', '4ea8e185f297fa1e5706a8337719effe', '<strong>Parent</strong> &mdash; Categories, unlike tags, can have a hierarchy. You might have a Jazz category, and under that have child categories for Bebop and Big Band. Totally optional. To create a subcategory, just choose another category from the Parent dropdown.', '0', '0', 'LINE', '', '10', '', 'eec619c60b3b0a3e38f0069c120d2602', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6094', 'en', 'default', '8f6225bd7662575ef84d375fec88dbd4', '<strong>Parent</strong> &mdash; You can arrange your pages in hierarchies. For example, you could have an &#8220;About&#8221; page that has &#8220;Life Story&#8221; and &#8220;My Dog&#8221; pages under it. There are no limits to how many levels you can nest pages.', '0', '0', 'LINE', '', '10', '', 'a7d363674bc0d711d6d160e3dbf13846', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6095', 'en', 'default', 'd1bb204120db5310aec8f2490431cb76', '<strong>Please Note:</strong> Any customizations you have made to theme files will be lost. Please consider using <a href="%s">child themes</a> for modifications.', '0', '0', 'LINE', '', '10', '', '04573092292e1d20b219c5d37cabb34e', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6096', 'en', 'default', '91cc965a84f790ad2906d697f3119a1d', '<strong>Post editor</strong> &mdash; Enter the text for your post. There are two modes of editing: Visual and Text. Choose the mode by clicking on the appropriate tab.', '0', '0', 'LINE', '', '10', '', 'a0bfc377e504c07ae3b7b4ee7eb27344', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6097', 'en', 'default', 'b807523847b38ac8553394a6e915ef62', '<strong>Preview</strong> will show you what your draft post will look like if you publish it. View will take you to your live site to view the post. Which link is available depends on your post&#8217;s status.', '0', '0', 'LINE', '', '10', '', 'feb9ddd4b67850aee6a2151805f1dfa8', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6098', 'en', 'default', 'ad831971b7a4b43e2ef0d627e297902a', '<strong>Publish</strong> &mdash; You can set the terms of publishing your post in the Publish box. For Status, Visibility, and Publish (immediately), click on the Edit link to reveal more options. Visibility includes options for password-protecting a post or making it stay at the top of your blog indefinitely (sticky). The Password protected option allows you to set an arbitrary password for each post. The Private option hides the post from everyone except editors and administrators. Publish (immediately) allows you to set a future or past date and time, so you can schedule a post to be published in the future or backdate a post.', '0', '0', 'LINE', '', '10', '', 'ffea9d2f9ee57d2e3ab4a669c39607c5', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6099', 'en', 'default', '78bf51b73e62500109ff97739c24bb7d', '<strong>Quick Draft</strong> &mdash; Allows you to create a new post and save it as a draft. Also displays links to the 5 most recent draft posts you\'ve started.', '0', '0', 'LINE', '', '10', '', 'ccbc678b1234e3865ff243cf2f5e033b', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6100', 'en', 'default', '099f3df0632488f2c47e2658d95e0e76', '<strong>Quick Edit</strong> provides inline access to the metadata of your post, allowing you to update post details without leaving this screen.', '0', '0', 'LINE', '', '10', '', 'aec7db39f9755f7c2dc6e2b37c8412c2', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6101', 'en', 'default', 'b7afe14ef93e550358d9308fbcdf9df0', '<strong>Random:</strong> Show a different image on each page.', '0', '0', 'LINE', '', '10', '', 'ba08a9ca69ff15ee804b268fc9029e72', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6102', 'en', 'default', 'a7e4d48c9f714a92b5b5beb3db05ad38', '<strong>Remove</strong> allows you to remove a user from your site. It does not delete their content. You can also remove multiple users at once by using Bulk Actions.', '0', '0', 'LINE', '', '10', '', '5fe47707a48d7746511ccf9843929025', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6103', 'en', 'default', 'a98be58ec342822c43f9a60f423b1d2f', '<strong>Screen Options</strong> &mdash; Use the Screen Options tab to choose which Dashboard boxes to show.', '0', '0', 'LINE', '', '10', '', 'ed407f0af001c6226b4cc9be2875d701', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6104', 'en', 'default', 'd6ce148cfd01c369f1b23045e489b491', '<strong>Send Trackbacks</strong> &mdash; Trackbacks are a way to notify legacy blog systems that you&#8217;ve linked to them. Enter the URL(s) you want to send trackbacks. If you link to other WordPress sites they&#8217;ll be notified automatically using pingbacks, and this field is unnecessary.', '0', '0', 'LINE', '', '10', '', '0671b4a2f6125c4f545933974afb647d', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6105', 'en', 'default', '0d7d65c866eb8c69ac9cb51558adfa14', '<strong>Settings</strong> &mdash; This page shows a list of all settings associated with this site. Some are created by WordPress and others are created by plugins you activate. Note that some fields are grayed out and say Serialized Data. You cannot modify these values due to the way the setting is stored in the database.', '0', '0', 'LINE', '', '10', '', 'd354fd7e8af531c92dc88db3ef74cfe4', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6106', 'en', 'default', '411d40a6a21e11c47ed8adb1c92f00b0', '<strong>Slug</strong> &mdash; The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.', '0', '0', 'LINE', '', '10', '', '97af8d8b956434fb602f37b6e0e53e27', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6107', 'en', 'default', '597ef2b39aedb4e7f14e838eed92b8f7', '<strong>Template</strong> &mdash; Some themes have custom templates you can use for certain pages that might have additional features or custom layouts. If so, you&#8217;ll see them in this dropdown menu.', '0', '0', 'LINE', '', '10', '', '62319763264b08b9688c6a9f025316ba', '0', '');
