INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6848', 'en', 'default', 'cd7b8cf1cfc4fb579df5f63f419c3f5f', 'If you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.', '0', '0', 'LINE', '', '10', '', '88498cc2eeef4905ce9452eb8241da52', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6849', 'en', 'default', 'ae1bc04b5e3967feb6adc498b8d57f62', 'If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.', '0', '0', 'LINE', '', '10', '', 'c0b485544617c4aba2e6cc625c5732d8', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6850', 'en', 'default', '62f7387a9ef151c294e680b2fd42169e', 'If you have marked plugins as favorites on WordPress.org, you can browse them here.', '0', '0', 'LINE', '', '10', '', 'b8fec56cb45e1a17dc0a62f2b168910f', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6851', 'en', 'default', '7292a018caf8f27efeec3ee8fdaea12d', 'If you have marked themes as favorites on WordPress.org, you can browse them here.', '0', '0', 'LINE', '', '10', '', '4e181b871f87a1027dd5942943ef34ea', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6852', 'en', 'default', '8ba5adc334d2585a8a27cc06d82e8a3f', 'If you have posts or comments in another system, WordPress can import those into this site. To get started, choose a system to import from below:', '0', '0', 'LINE', '', '10', '', '02495c0abfdb5ea16804a08a9c3efe8a', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6853', 'en', 'default', 'c5ecefc2c05db6570556c7385ac2e8a3', 'If you haven&#8217;t yet created any menus, <strong>click the &#8217;create a new menu&#8217; link</strong> to get started', '0', '0', 'LINE', '', '10', '', 'e3750bb5eb2eb05b624dbab6c20b5e59', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6854', 'en', 'default', '2448f34ad2e38271ffbcf4d299c17c5d', 'If you just want to get an idea of what&#8217;s available, you can browse Featured and Popular plugins by using the links above the plugins list. These sections rotate regularly.', '0', '0', 'LINE', '', '10', '', '575aca988849707fdbbfd60be15902e1', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6855', 'en', 'default', 'a379ef32870b64a6ef175d6e3da0bf17', 'If you know what you&#8217;re looking for, Search is your best bet. The Search screen has options to search the WordPress Plugin Directory for a particular Term, Author, or Tag. You can also search the directory by selecting popular tags. Tags in larger type mean more plugins have been labeled with that tag.', '0', '0', 'LINE', '', '10', '', '2dfd3ebb5bbf8256c5c0cc8fefb8b3c8', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6856', 'en', 'default', 'b642d452dd24b19ed95b29d92e97240d', 'If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.', '0', '0', 'LINE', '', '10', '', 'd794b6153c4a4b8146e4b05cafb43a27', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6857', 'en', 'default', 'b821f0a93d744e025849cd46e8b3baad', 'If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.', '0', '0', 'LINE', '', '10', '', '2adafd60d076932c43e67845ed14dde0', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6858', 'en', 'default', '864e67dda7ff0dc96db5c841bdbf98ad', 'If you like, you may enter custom structures for your category and tag URLs here. For example, using <code>topics</code> as your category base would make your category links like <code>%s/topics/uncategorized/</code>. If you leave these blank the defaults will be used.', '0', '0', 'LINE', '', '10', '', 'd635a782b4c7393661373e724751b36c', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6859', 'en', 'default', '837a1e84e411703eb806ddee77465493', 'If you need to re-install version %s, you can do so here:', '0', '0', 'LINE', '', '10', '', '05757d13169fcca8a5f39dae14249346', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6860', 'en', 'default', '1a89b9744e617ef3fb4ab7c4fffee90c', 'If you pick an option other than Plain, your general URL path with structure tags (terms surrounded by <code>%</code>) will also appear in the custom structure field and your path can be further modified there.', '0', '0', 'LINE', '', '10', '', '8a085eced0d0591c402c82cff68cbc18', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6861', 'en', 'default', '97b78ef138769a3fcf7e03efeafe2005', 'If you reach out to us, we\'ll also ensure you\'ll never have this problem again.', '0', '0', 'LINE', '', '10', '', 'cea417fb3ad33a8c6e47bd88db6f8df1', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6862', 'en', 'default', 'b1547fa31c5744e25be92a64e7f77beb', 'If you reached this screen by accident and meant to visit one of your own sites, here are some shortcuts to help you find your way.', '0', '0', 'LINE', '', '10', '', '08cbe037e394e47b4dc740a5ae61ce70', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6863', 'en', 'default', '12c31c3cb7ab49899ec2e979d5a553f5', 'If you temporarily make your %s file writable for us to generate rewrite rules automatically, do not forget to revert the permissions after rule has been saved.', '0', '0', 'LINE', '', '10', '', 'fbfb20c605ce87bf0b18c0013694071e', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6864', 'en', 'default', 'a98ef57dff34e18723548ccd8a286c59', 'If you temporarily make your site&#8217;s root directory writable for us to generate the %s file automatically, do not forget to revert the permissions after the file has been created.', '0', '0', 'LINE', '', '10', '', '55f26516c6be022a2bae7e814fdb1559', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6865', 'en', 'default', '64771a7ce98863e88b3b4e2c1448f6d0', 'If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.', '0', '0', 'LINE', '', '10', '', '69ef71fb437c6bf62fc83a4ccf0f54b5', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6866', 'en', 'default', '28479dd04f0c4f904cbfc647df8a39f7', 'If you use your site for commercial purposes and you engage in more complex collection or processing of personal data, you should note the following information in your privacy policy in addition to the information we have already discussed.', '0', '0', 'LINE', '', '10', '', '26059df016ea17b5bee3abc3165cc69d', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6867', 'en', 'default', 'efe517a5b918a12ecb7dfd17f3877327', 'If you want site visitors to be able to register themselves, as opposed to by the site administrator, check the membership box. A default user role can be set for all new users, whether self-registered or registered by the site admin.', '0', '0', 'LINE', '', '10', '', '1e0104cd42ac1e2fe540ba466d5ff248', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6868', 'en', 'default', 'e8953b095643b4bf6a1cd0bae7a85508', 'If you want to convert your categories to tags (or vice versa), use the <a href="%s">Categories and Tags Converter</a> available from the Import screen.', '0', '0', 'LINE', '', '10', '', '194c0e92da833182de4233fc3786e2b7', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6869', 'en', 'default', 'be3d2742b2dbbb1878b22b8702b6e8d7', 'If you want to install a plugin that you&#8217;ve downloaded elsewhere, click the Upload Plugin button above the plugins list. You will be prompted to upload the .zip package, and once uploaded, you can activate the new plugin.', '0', '0', 'LINE', '', '10', '', '313943fe8cc1a3d691aa966a6a6819c7', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6870', 'en', 'default', '0b5d8aeeb0c74419d4028dca5dc744df', 'If you want to make changes but don&#8217;t want them to be overwritten when the plugin is updated, you may be ready to think about writing your own plugin. For information on how to edit plugins, write your own from scratch, or just better understand their anatomy, check out the links below.', '0', '0', 'LINE', '', '10', '', '8c4742c33256ee314435258e3a200070', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6871', 'en', 'default', 'fc276f47f9e88e53fb9a81e0e683a057', 'If you want to remove the widget but save its setting for possible future use, just drag it into the Inactive Widgets area. You can add them back anytime from there. This is especially helpful when you switch to a theme with fewer or different widget areas.', '0', '0', 'LINE', '', '10', '', 'f5f6f5978f1a37ee120927289f3f6f8d', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6872', 'en', 'default', 'b54fa9afe2dc888d8a5c71cc1b61b51c', 'If you want to run multiple WordPress installations in a single database, change this.', '0', '0', 'LINE', '', '10', '', '7ed16a5d29814e6517b04e35979dbb8c', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6873', 'en', 'default', 'ce99e8b4ddb1935ad216af170d465663', 'If you would like to see more plugins to choose from, click on the &#8220;Add New&#8221; button and you will be able to browse or search for additional plugins from the <a href="%s">WordPress Plugin Directory</a>. Plugins in the WordPress Plugin Directory are designed and developed by third parties, and are compatible with the license WordPress uses. Oh, and they&#8217;re free!', '0', '0', 'LINE', '', '10', '', '918021f3c1c7333bbb985975acdf69b3', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6874', 'en', 'default', 'ff1e9b8584871613da97bf909bf0d3d4', 'If you would like to see more themes to choose from, click on the &#8220;Add New&#8221; button and you will be able to browse or search for additional themes from the <a href="%s">WordPress Theme Directory</a>. Themes in the WordPress Theme Directory are designed and developed by third parties, and are compatible with the license WordPress uses. Oh, and they&#8217;re free!', '0', '0', 'LINE', '', '10', '', '85b7f40dae14e2dedd2d051b8da068b4', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6875', 'en', 'default', '5074f6b262894aae8f6923d7ff9eadf1', 'If your %1$s file was <a href="%2$s">writable</a>, we could do this automatically, but it isn&#8217;t so these are the mod_rewrite rules you should have in your %1$s file. Click in the field and press %3$s to select all.', '0', '0', 'LINE', '', '10', '', '0651b69befec7bf871bf4d593b4eb1cf', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6876', 'en', 'default', '93f3cd2b6a8fda8223f25e6fd0f47db4', 'If your %1$s file was <a href="%2$s">writable</a>, we could do this automatically, but it isn&#8217;t so this is the url rewrite rule you should have in your %1$s file. Click in the field and press %3$s to select all. Then insert this rule inside of the %4$s element in %1$s file.', '0', '0', 'LINE', '', '10', '', '4768687268baff9591b17ec71c06e3d6', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6877', 'en', 'default', 'ae4333ffddf970f98ea2387193cc0f5b', 'If your theme has more than one default header image, or you have uploaded more than one custom header image, you have the option of having WordPress display a randomly different image on each page of your site. Click the &#8220;Random&#8221; radio button next to the Uploaded Images or Default Images section to enable this feature.', '0', '0', 'LINE', '', '10', '', 'aad695b974325b8e604c6a490dbf8754', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6878', 'en', 'default', '3ac9c7fe01cf02c25932c2fce99d968a', 'If your web site provides a service which includes automated decision making - for example, allowing customers to apply for credit, or aggregating their data into an advertising profile - you must note that this is taking place, and include information about how that information is used, what decisions are made with that aggregated data, and what rights users have over decisions made without human intervention.', '0', '0', 'LINE', '', '10', '', 'c7ffd4403fc114954b738bbcbe9fea06', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6879', 'en', 'default', 'b127c8939223b7c79e41917477d2e09e', 'If your web site receives data about users from third parties, including advertisers, this information must be included within the section of your privacy policy dealing with third party data.', '0', '0', 'LINE', '', '10', '', 'bdb7658161c5f57d631ee4aa4a631ecf', '0', '');
