INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6918', 'en', 'default', 'ddfa3b051bb82c9c70d438b8e5871308', 'In the <strong>Author</strong> column, in addition to the author&#8217;s name, email address, and blog URL, the commenter&#8217;s IP address is shown. Clicking on this link will show you all the comments made from this IP address.', '0', '0', 'LINE', '', '10', '', '944f932d0423b726bd23dab71fea8505', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6919', 'en', 'default', '78516f0126f95864e9dd3d48b6d7504f', 'In the <strong>Comment</strong> column, hovering over any comment gives you options to approve, reply (and approve), quick edit, edit, spam mark, or trash that comment.', '0', '0', 'LINE', '', '10', '', '68411cf81ef029f42a0ec46594a3f9c0', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6920', 'en', 'default', '6d7053230d152b1bbde8e0e11985e6cd', 'In the <strong>In Response To</strong> column, there are three elements. The text is the name of the post that inspired the comment, and links to the post editor for that entry. The View Post link leads to that post on your live site. The small bubble with the number in it shows the number of approved comments that post has received. If there are pending comments, a red notification circle with the number of pending comments is displayed. Clicking the notification circle will filter the comments screen to show only pending comments on that post.', '0', '0', 'LINE', '', '10', '', 'a0b6f98a1737347916c97d5e7392c2d6', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6921', 'en', 'default', '75a9d96583454bb73d919516b14c1020', 'In the <strong>Submitted On</strong> column, the date and time the comment was left on your site appears. Clicking on the date/time link will take you to that comment on your live site.', '0', '0', 'LINE', '', '10', '', 'c7841636b76ce9101ba9cc808e1096e5', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6922', 'en', 'default', 'a1e79989a368fffa040f3724cb25bb0a', 'In the Header Text section of this page, you can choose whether to display this text or hide it. You can also choose a color for the text by clicking the Select Color button and either typing in a legitimate HTML hex value, e.g. &#8220;#ff0000&#8221; for red, or by choosing a color using the color picker.', '0', '0', 'LINE', '', '10', '', 'bef7f0dcaa96c84388ca68674dbeea63', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6923', 'en', 'default', 'bb1232b0272e71fd61576bb759fe4fcb', 'In this section you should explain how long you retain personal data collected or processed by the web site. While it is your responsibility to come up with the schedule of how long you keep each dataset for and why you keep it, that information does need to be listed here. For example, you may want to say that you keep contact form entries for six months, analytics records for a year, and customer purchase records for ten years.', '0', '0', 'LINE', '', '10', '', 'ab44f2d90a4122efb4d73b1271ddcd1e', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6924', 'en', 'default', '9f2feaf2b829a5c3749cb3a0dec950a7', 'In this section you should explain what measures you have taken to protect your users&#8217; data. This could include technical measures such as encryption; security measures such as two factor authentication; and measures such as staff training in data protection. If you have carried out a Privacy Impact Assessment, you can mention it here too.', '0', '0', 'LINE', '', '10', '', '447f7c9e79da2eaf80b14485c81eef4a', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6925', 'en', 'default', 'cc868b88b34779f820016d60eeb4d13f', 'In this section you should explain what procedures you have in place to deal with data breaches, either potential or real, such as internal reporting systems, contact mechanisms, or bug bounties.', '0', '0', 'LINE', '', '10', '', '2e2f9f76d2e53db3e5050f6eed876131', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6926', 'en', 'default', '7b43f0a3a9bad71b5515c3febf1c4e85', 'In this section you should explain what rights your users have over their data and how they can invoke those rights.', '0', '0', 'LINE', '', '10', '', '1d494e615fc6d7af13588575aa5f764a', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6927', 'en', 'default', 'e033cd0f72a714684763bb3b10497ef1', 'In this section you should list all transfers of your site data outside the European Union and describe the means by which that data is safeguarded to European data protection standards. This could include your web hosting, cloud storage, or other third party services.', '0', '0', 'LINE', '', '10', '', '6bab02ff41df219f416fc29c55fd9271', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6928', 'en', 'default', '88afac7dd32e40bf990b8d3423dfcb5e', 'In this section you should name and list all third party providers with whom you share site data, including partners, cloud-based services, payment processors, and third party service providers, and note what data you share with them and why. Link to their own privacy policies if possible.', '0', '0', 'LINE', '', '10', '', 'bc39528f72dd657a817abfe0e70fa67f', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6929', 'en', 'default', 'afb5c651f25a99fe9dea21458989b965', 'In this section you should note what personal data you collect from users and site visitors. This may include personal data, such as name, email address, personal account preferences; transactional data, such as purchase information; and technical data, such as information about cookies.', '0', '0', 'LINE', '', '10', '', '55364a8c7c34dcaec179a49ce5feb8ac', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('6930', 'en', 'default', '36ce374000d338cd986460ce312bcae5', 'In this section you should note your site URL, as well as the name of the company, organization, or individual behind it, and some accurate contact information.', '0', '0', 'LINE', '', '10', '', '3ee9c2dd60584a7dde9b3eda4294c2d0', '0', '');
